import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Footer from "../components/Footer";

const Book = () => {
  const [selectedService, setSelectedService] = useState(null);
  const [date, setDate] = useState("");
  const [time, setTime] = useState("");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [contactNumber, setContactNumber] = useState("");

  const navigate = useNavigate();

  const handleBookNowClick = () => {
    const bookingDetails = {
      selectedService,
      date,
      time,
      name,
      email,
      contactNumber,
    };
    navigate("/confirmation", { state: bookingDetails });
  };

  return (
    <div>
      {/* Booking Section */}
      <section className="container items">
        <h1 className="fs-700 ff-serif text-center">Booking</h1>

        {/* Select service */}
        <div className="container">
          <h2 className="fs-600 ff-serif">Select Service</h2>
          <div className="d-flex justify-content-around">
            {[1, 2, 3].map((i) => (
              <div className="card" style={{ width: "18rem" }} key={i}>
                <label htmlFor={`service${i}`}>
                  <img
                    src="../assets/images/img_1.jpg"
                    className="card-img-top"
                    alt="..."
                  />
                  <div className="card-body">
                    <h5 className="card-title fs-500 ff-serif">
                      All day/All night Pass
                    </h5>
                    <p className="card-text fs-500">â‚± 250.00</p>
                    <input
                      type="radio"
                      className="btn-check"
                      name="service"
                      id={`service${i}`}
                      autoComplete="off"
                      onChange={() => setSelectedService(`Service ${i}`)}
                    />
                    <label
                      className="btn btn-primary-clr"
                      htmlFor={`service${i}`}
                    >
                      Select
                    </label>
                  </div>
                </label>
              </div>
            ))}
          </div>
        </div>

        <hr />
        {/* Select date */}
        <div className="container">
          <h2 className="fs-600 ff-serif">Select Day</h2>
          <input
            type="date"
            name="date"
            id="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
          />
        </div>

        <hr />
        {/* Select Time */}
        <div className="container">
          <h2 className="fs-600 ff-serif">Select Time</h2>
          <input
            type="time"
            name="time"
            id="time"
            value={time}
            onChange={(e) => setTime(e.target.value)}
          />
        </div>

        <hr />
        {/* Fill out information */}
        <div className="container">
          <h2 className="fs-600 ff-serif">Fill up Information</h2>
          <form action="#" method="POST">
            <div className="mb-3">
              <label htmlFor="exampleInputName" className="form-label">
                Name
              </label>
              <input
                type="text"
                className="form-control"
                id="exampleInputName"
                placeholder="Enter your name"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="exampleInputEmail1" className="form-label">
                Email address
              </label>
              <input
                type="email"
                className="form-control"
                id="exampleInputEmail1"
                aria-describedby="emailHelp"
                placeholder="Enter email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>

            <div className="mb-3">
              <label htmlFor="exampleInputContactNumber" className="form-label">
                Contact Number
              </label>
              <input
                type="text"
                className="form-control"
                id="exampleInputContactNumber"
                placeholder="Enter contact number"
                value={contactNumber}
                onChange={(e) => setContactNumber(e.target.value)}
                required
              />
            </div>
          </form>
        </div>
        <div className="container text-center">
          <button className="btn btn-primary-clr" onClick={handleBookNowClick}>
            Book Now!
          </button>
        </div>
      </section>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Book;
